import React from "react";
import styled from "styled-components";

const ListUser = ({ ProfilePicture, Name, Link, Company, Address, Stars }) => (
  <Container>
    <ul>
      <li>
        <div className="BoxInforStart">
          <div className="BoxImgPerfil">
            <img src={ProfilePicture} />
          </div>
          <div className="BoxNome">
            <h3>
              {Name}
              <svg
                xmlns="http://www.w3.org/2000/svg"
                width="11"
                height="16"
                viewBox="0 0 11 16"
                fill="none"
              >
                <path
                  d="M0.4375 14.125L6.5625 8L0.4375 1.875L2.3125 0L10.3125 8L2.3125 16L0.4375 14.125Z"
                  fill="black"
                />
              </svg>
            </h3>
            <p>{Link}</p>
          </div>
          <div className="BoxDelete">
            <span>
              <svg
                xmlns="http://www.w3.org/2000/svg"
                viewBox="0 0 14 18"
                fill="none"
              >
                <path
                  d="M13.9844 0.984375V3H0.015625V0.984375H3.48438L4.51562 0H9.48438L10.5156 0.984375H13.9844ZM1 15.9844V3.98438H13V15.9844C13 16.5156 12.7969 16.9844 12.3906 17.3906C11.9844 17.7969 11.5156 18 10.9844 18H3.01562C2.48438 18 2.01562 17.7969 1.60938 17.3906C1.20312 16.9844 1 16.5156 1 15.9844Z"
                  fill="black"
                />
              </svg>
            </span>
          </div>
        </div>
        <div className="BoxInforEnd">
          <div>
            <p>{Company}</p>
          </div>
          <div>
            <p>{Address}</p>
          </div>
          <div>
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="14"
              height="13"
              viewBox="0 0 14 13"
              fill="none"
            >
              <path
                d="M7 10.5L2.875 13L3.96875 8.3125L0.34375 5.15625L5.125 4.75L7 0.34375L8.875 4.75L13.6562 5.15625L10.0312 8.3125L11.125 13L7 10.5Z"
                fill="#E5E5E5"
              />
            </svg>
            <p>{Stars}</p>
          </div>
        </div>
      </li>
    </ul>
  </Container>
);

const Container = styled.div`
  background-color: #fff;
  display: flex;
  background: red;
  ul {
    margin: 0px;
    padding: 0px;
    width: 100%;
    li {
      background-color: #fff;
      padding: 20px;
      width: auto;
      border: solid 1px;
      margin: 10px 10% 10px 10%;
      display: flex;
      flex-direction: column;
      div.BoxInforStart {
        background: red;
        display: flex;
        flex-direction: row;
        div.BoxImgPerfil {
          width: 70px;
          height: 70px;
          margin-right: 15px;
          justify: center;
          align-items: center;
          background: blue;
        }
        div.BoxNome {
          display: flex;
          justify-content: center;
          flex-direction: column;
          h3 {
            font-size: 22px;
          }
          svg {
            margin-left: 10px;
            height: 15px;
          }
          p {
            color: black;
            font-size: 16px;
          }
        }
        div.BoxDelete {
          background: yellow;
          display: flex;
          flex: 1;
          justify-content: end;
          padding: 5px;
          span {
            background: #cecece;
            display: flex;
            height: 35px;
            width: 35px;
            justify-content: center;
            align-items: center;
            border-radius: 50%;
            cursor: pointer;
          }
          svg {
            height: 20px;
            width: 20px;
          }
        }
      }
    }
  }
`;

export default ListUser;
